INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 102301, 0.0, "2030/12/17 14:59:59", 24001, 24, 401, "アヤネ", 2, 2, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 102301, 0.0, "2030/12/17 14:59:59", 24002, 24, 402, "アヤネ", 2, 1, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 102301, 0.0, "2030/12/17 14:59:59", 24003, 24, 403, "アヤネ", 2, 2, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192201, 0.0, "2030/12/17 14:59:59", 24004, 24, 701, "アサヒ", 1, 2, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192201, 0.0, "2030/12/17 14:59:59", 24005, 24, 702, "アサヒ", 2, 1, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192201, 0.0, "2030/12/17 14:59:59", 24006, 24, 703, "アサヒ", 1, 2, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192301, 0.0, "2030/12/17 14:59:59", 24007, 24, 801, "部員３", 2, 2, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192301, 0.0, "2030/12/17 14:59:59", 24008, 24, 802, "部員３", 2, 1, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192301, 0.0, "2030/12/17 14:59:59", 24009, 24, 803, "部員３", 2, 2, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192501, 0.0, "2030/12/17 14:59:59", 24010, 24, 501, "", 1, 1, "2020/07/31 12:00:00", "やった！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192501, 0.0, "2030/12/17 14:59:59", 24011, 24, 502, "", 1, 1, "2020/07/31 12:00:00", "勝ったよ！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192501, 0.0, "2030/12/17 14:59:59", 24012, 24, 503, "", 1, 1, "2020/07/31 12:00:00", "いい調子！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113501, 0.0, "2030/12/17 14:59:59", 24013, 24, 111, "ミサト", 2, 6, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113501, 0.0, "2030/12/17 14:59:59", 24014, 24, 112, "ミサト", 2, 1, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113501, 0.0, "2030/12/17 14:59:59", 24015, 24, 113, "ミサト", 2, 1, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192401, 0.0, "2030/12/17 14:59:59", 24016, 24, 611, "ダイチ", 2, 1, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192401, 0.0, "2030/12/17 14:59:59", 24017, 24, 612, "ダイチ", 2, 1, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192401, 0.0, "2030/12/17 14:59:59", 24018, 24, 613, "ダイチ", 2, 2, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113401, 0.0, "2030/12/17 14:59:59", 24019, 24, 211, "ハツネ", 1, 2, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113401, 0.0, "2030/12/17 14:59:59", 24020, 24, 212, "ハツネ", 1, 2, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 113401, 0.0, "2030/12/17 14:59:59", 24021, 24, 213, "ハツネ", 2, 1, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 106501, 0.0, "2030/12/17 14:59:59", 24022, 24, 311, "カヤ", 2, 1, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 106501, 0.0, "2030/12/17 14:59:59", 24023, 24, 312, "カヤ", 2, 1, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 106501, 0.0, "2030/12/17 14:59:59", 24024, 24, 313, "カヤ", 1, 6, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 102301, 0.0, "2030/12/17 14:59:59", 24025, 24, 421, "アヤネ", 3, 4, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192201, 0.0, "2030/12/17 14:59:59", 24026, 24, 721, "アサヒ", 1, 2, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192301, 0.0, "2030/12/17 14:59:59", 24027, 24, 821, "部員３", 3, 1, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 192501, 0.0, "2030/12/17 14:59:59", 24028, 24, 521, "", 1, 1, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 113501, 0.0, "2030/12/17 14:59:59", 24029, 24, 101, "ミサト", 2, 1, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 113501, 0.0, "2030/12/17 14:59:59", 24030, 24, 102, "ミサト", 2, 1, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 113501, 0.0, "2030/12/17 14:59:59", 24031, 24, 103, "ミサト", 2, 2, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 113501, 0.0, "2030/12/17 14:59:59", 24032, 24, 104, "ミサト", 1, 2, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 10046);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 113501, 0.0, "2030/12/17 14:59:59", 24033, 24, 105, "ミサト", 2, 1, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 10046);
